pragma solidity >=0.4.21 <0.6.0;

import './Patient.sol';
import './Doctor.sol';
import './Person.sol';

contract ContractFactory {
  event ContractCreated (address user, address contractAddress);

  address private owner;
  mapping(address => address) private addressToContractInstance;
  address private interactionContractAddress;

  constructor(address _interactionContractAddress) public {
    owner = msg.sender;
    interactionContractAddress = _interactionContractAddress;
  }

  modifier onlyOwner() {
    if (owner == msg.sender) _;
  }

  modifier onlyIfNotExists() {
    if (addressToContractInstance[msg.sender] == address(0)) _;
  }

  function setInteractionContractAddress(address _interactionContractAddress) public onlyOwner {
    interactionContractAddress = _interactionContractAddress;
  }

  function setOwner(address _newOwner) public onlyOwner {
    owner = _newOwner;
  }

  function getOwner() public view returns(address) {
    return owner;
  }

  function getInteractionContractAddress() public view returns(address) {
    return interactionContractAddress;
  }

  function createContract(bool _isDoctor) public onlyIfNotExists{
    Person personContract;
    if (_isDoctor) {
      personContract = new Doctor(msg.sender, interactionContractAddress);
    } else {
      personContract = new Patient(msg.sender, interactionContractAddress);
    }
    address contractAddress = address(personContract);
    addressToContractInstance[msg.sender] = contractAddress;
    emit ContractCreated(msg.sender, contractAddress);
  }

  function emitEvent() public {
    emit ContractCreated(msg.sender, msg.sender);
  }

  function getContractAddress() public view returns (address) {
    return addressToContractInstance[msg.sender];
  }

  function getContractAddress(address _user) public view returns (address) {
    return addressToContractInstance[_user];
  }
}
